import App from '../App';
import Search from './search';
import UserInfo from './user-info';
import Actions from './actions';
import Repos from './repos';

import React from 'react';

const AppContent = ({ userinfo, repos }) => (
  <div className="app">
    <Search />
    {userinfo && <UserInfo />}
    {userinfo && <Actions />}

    {!!repos.length && (
      <Repos
        className="Repos"
        title="Repositórios"
        repos={[
          {
            name: 'Nome do repositório',
            link: '#',
          },
          {
            name: 'Bruno óleo de peroba',
            link: 'peroba.com',
          },
        ]}
      />
    )}

    <Repos
      className="Starred"
      title="Favoritos"
      repos={[
        {
          name: 'The name of cuck',
          link: 'briuno',
        },
        {
          name: 'bruno é macaco',
          link: 'wikihow',
        },
      ]}
    />
  </div>
);

export default AppContent;
